'''Crie um Python Script que conte quantas vezes cada nome está presente em uma
lista [’nome1’, ’nome2’, ...] e armazena essa contagem em um dicionário {’nome1’:
xvezes, ’nome2’: yvezes, ....}.'''
"""Maldito espaço antes do codigo, 2 horas pra fazer funcionar """
def contar_nomes(nomes):

  contar = {}
  for nome in nomes:
    if nome not in contar:
      contar[nome] = 0
    contar[nome] += 1
  return contar

nomes = ["William", "Breno", "Vinicius", "Victor", "Lazim", "Kadidja", "William", "Breno"]
contar = contar_nomes(nomes)
print(contar)

'''Crie um Python Script que realize o mesmo procedimento da questão anterior. No
entanto, ao invés do conteúdo da lista nomes ser atribuído no próprio script, faça
uma estrutura de repetição na qual ela leia uma string do usuário e adicione os nomes
digitados por ele, um de cada vez, na lista nomes. O término da adição de nomes
deve ser indicado quando o usuário inserir uma string vazia (”).'''

def conta_nomes():
    lista = []
    while True:
        nome = input("Digite um nome (ou pressione enter para terminar): ")
        if nome == '':
            break
        lista.append(nome)

    dicionario = {}
    for nome in lista:
        if nome in dicionario:
            dicionario[nome] += 1
        else:
            dicionario[nome] = 1
    return dicionario

print(conta_nomes())

'''Crie um programa que lê uma mensagem do usuário. Com esta mensagem, faça uma
nova omitindo trocando todos os caracteres de nomes próprios por ’*’. Exemplo:
se a mensagem for ’Lucas foi ao shopping com Fernanda assistir aquele filme da
Marvel’, a nova mensagem deverá ser ’***** foi ao shopping com ******** assistir
aquele filme da ******’. Assuma que um nome próprio sempre começa com letra
maiúscula e contém apenas letras.'''

def Censura_maiuscula():
    mensagem = input("Digite uma mensagem: ")
    palavras = mensagem.split()
    nova_mensagem = ""
    for palavra in palavras:
        if palavra[0].isupper():
            nova_mensagem += '*' * len(palavra) + ' '
        else:
            nova_mensagem += palavra + ' '
    return nova_mensagem.strip()

print(Censura_maiuscula())

'''Faça um programa que leia seis valores numéricos atribuindo-os à duas variáveis do
tipo lista com três elementos cada. Cada variável irá representar um vetor, informe o
produto escalar e o produto vetorial destes vetores.'''
def calcula_produtos():
    vetor1 = [float(input("Digite o valor para o vetor 1: ")) for _ in range(3)]
    vetor2 = [float(input("Digite o valor para o vetor 2: ")) for _ in range(3)]

    produto_escalar = sum(a*b for a, b in zip(vetor1, vetor2))

    produto_vetorial = [vetor1[1]*vetor2[2] - vetor1[2]*vetor2[1],
                        vetor1[2]*vetor2[0] - vetor1[0]*vetor2[2],
                        vetor1[0]*vetor2[1] - vetor1[1]*vetor2[0]]

    print("Produto escalar: ", produto_escalar)
    print("Produto vetorial: ", produto_vetorial)

calcula_produtos()

'''Escreva um programa que leia um número N. Em sequência, ele deve ser N números
e armazená-los em uma lista.'''
def numeros():
    N = int(input("Digite um número N: "))
    lista = []
    for i in range(N):
        num = float(input("Digite o número " + str(i+1) + ": "))
        lista.append(num)
    return lista

print(numeros())

'''Com o programa acima, imprima: A soma dos itens, a média dos valores, o maior e
o menor valor.'''
def numeros():
    N = int(input("Digite um número N: "))
    lista = []
    for i in range(N):
        num = float(input("Digite o número " + str(i+1) + ": "))
        lista.append(num)

    soma = sum(lista)
    media = soma / N
    maior = max(lista)
    menor = min(lista)

    print("Soma dos itens: ", soma)
    print("Média dos valores: ", media)
    print("Maior valor: ", maior)
    print("Menor valor: ", menor)

    return lista


print(numeros())